const Card = ({title, imageUrl, body}) => {
    return (
  <div className="card-container">
      <div className="image-container">
        <img src={imageUrl} alt="react icon"/>
        <div className="card-content"></div>
      </div>
      
  </div>
  )
}

export default Card
